selector_to_html = {"a[href=\"scanmode.html#continuous-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Continuous Mode<a class=\"headerlink\" href=\"#continuous-mode\" title=\"Link to this heading\">#</a></h2><p>The scanner works continuously. If the scan is successful or the scan time exceeds the single working time, the current scan ends. If the time exceeds the specified time, the next scan is automatically triggered.</p>", "a[href=\"system.html#aiming-light\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Aiming Light<a class=\"headerlink\" href=\"#aiming-light\" title=\"Link to this heading\">#</a></h2><h3>Enable<a class=\"headerlink\" href=\"#id2\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#usb-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">USB Mode<a class=\"headerlink\" href=\"#usb-mode\" title=\"Link to this heading\">#</a></h2><h3>USB Keyboard<a class=\"headerlink\" href=\"#usb-keyboard\" title=\"Link to this heading\">#</a></h3>", "a[href=\"keyboard.html#character-encoding-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Character Encoding Settings<a class=\"headerlink\" href=\"#character-encoding-settings\" title=\"Link to this heading\">#</a></h2><h3>GBK(GB2312)<a class=\"headerlink\" href=\"#gbk-gb2312\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#id1\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">2D Symbologies<a class=\"headerlink\" href=\"#id1\" title=\"Link to this heading\">#</a></h2>", "a[href=\"system.html#volume-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Volume Settings<a class=\"headerlink\" href=\"#volume-settings\" title=\"Link to this heading\">#</a></h2><h3>Low Volume<a class=\"headerlink\" href=\"#low-volume\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#restore-default-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Restore Default Settings<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>When an unknown error occurs on the scanner, you can reset the scanner by restoring the default settings.</p>", "a[href=\"system.html#lighting-light\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Lighting Light<a class=\"headerlink\" href=\"#lighting-light\" title=\"Link to this heading\">#</a></h2><h3>Enable<a class=\"headerlink\" href=\"#enable\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html#scanning-interval\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Scanning Interval<a class=\"headerlink\" href=\"#scanning-interval\" title=\"Link to this heading\">#</a></h2><p>Working delay when scanning different barcodes</p>", "a[href=\"character.html#cancel-enter-new-line-crlf\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Cancel Enter+New Line(CRLF)<a class=\"headerlink\" href=\"#cancel-enter-new-line-crlf\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#block-barcodes-with-urls\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Block Barcodes With URLs<a class=\"headerlink\" href=\"#block-barcodes-with-urls\" title=\"Link to this heading\">#</a></h2><p>Block scanning of URL QR codes starting with <code class=\"docutils literal notranslate\"><span class=\"pre\">http://</span></code>, <code class=\"docutils literal notranslate\"><span class=\"pre\">https://</span></code></p>", "a[href=\"barcode.html#d-symbologies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">1D Symbologies<a class=\"headerlink\" href=\"#d-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"character.html#add-enter-cr\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Add Enter(CR)<a class=\"headerlink\" href=\"#add-enter-cr\" title=\"Link to this heading\">#</a></h2>", "a[href=\"scanmode.html#key-trigger-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Key Trigger Mode<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Press the button to trigger scanning, and release the button to end scanning. Scanning ends when the scan is successful or the reading time exceeds the single reading time.</p>", "a[href=\"system.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">System Settings<a class=\"headerlink\" href=\"#system-settings\" title=\"Link to this heading\">#</a></h1><h2>Restore Default Settings<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>When an unknown error occurs on the scanner, you can reset the scanner by restoring the default settings.</p>", "a[href=\"keyboard.html#keyboard-language\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Keyboard Language<a class=\"headerlink\" href=\"#keyboard-language\" title=\"Link to this heading\">#</a></h2><h3>Chinese<a class=\"headerlink\" href=\"#chinese\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Scan Mode<a class=\"headerlink\" href=\"#scan-mode\" title=\"Link to this heading\">#</a></h1><h2>Key Trigger Mode<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Press the button to trigger scanning, and release the button to end scanning. Scanning ends when the scan is successful or the reading time exceeds the single reading time.</p>", "a[href=\"barcode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Symbologies<a class=\"headerlink\" href=\"#symbologies\" title=\"Link to this heading\">#</a></h1><h2>1D Symbologies<a class=\"headerlink\" href=\"#d-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"scanmode.html#auto-sensing-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Auto Sensing Mode<a class=\"headerlink\" href=\"#auto-sensing-mode\" title=\"Link to this heading\">#</a></h2><p>In the auto sensing mode, the scanner will detect the brightness of the surrounding environment. When the brightness changes, the scan is triggered. The scan ends when the scan is successful or the scan time exceeds the single working time. Regardless of whether the last scan was successful or failed, the brightness of the surrounding environment will be detected again.</p>", "a[href=\"#nt-12895-wired-scanner-quick-setup-guide\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><strong>NT-12895</strong> Wired Scanner Quick Setup Guide<a class=\"headerlink\" href=\"#nt-12895-wired-scanner-quick-setup-guide\" title=\"Link to this heading\">#</a></h1>", "a[href=\"barcode.html#reversal-barcode-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Reversal Barcode Settings<a class=\"headerlink\" href=\"#reversal-barcode-settings\" title=\"Link to this heading\">#</a></h2><h3>No Support Reversal Barcode<a class=\"headerlink\" href=\"#no-support-reversal-barcode\" title=\"Link to this heading\">#</a></h3>", "a[href=\"character.html#add-enter-new-line-crlf\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Add Enter+New Line(CRLF)<a class=\"headerlink\" href=\"#add-enter-new-line-crlf\" title=\"Link to this heading\">#</a></h2>", "a[href=\"keyboard.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Keyboard Settings<a class=\"headerlink\" href=\"#keyboard-settings\" title=\"Link to this heading\">#</a></h1><h2>Character Encoding Settings<a class=\"headerlink\" href=\"#character-encoding-settings\" title=\"Link to this heading\">#</a></h2><h3>GBK(GB2312)<a class=\"headerlink\" href=\"#gbk-gb2312\" title=\"Link to this heading\">#</a></h3>", "a[href=\"character.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">End Character Settings<a class=\"headerlink\" href=\"#end-character-settings\" title=\"Link to this heading\">#</a></h1><p>The end character is added after the decoded data in the format of decoded data + end character.</p>", "a[href=\"system.html#get-firmware-version\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Get Firmware Version<a class=\"headerlink\" href=\"#get-firmware-version\" title=\"Link to this heading\">#</a></h2>", "a[href=\"character.html#cancel-enter-cr\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Cancel Enter(CR)<a class=\"headerlink\" href=\"#cancel-enter-cr\" title=\"Link to this heading\">#</a></h2>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
